<template>
	<view class="page">
		<view class="OrderCancellation">
			<view class="header">
				<view class="popupn">
					<view class="title line1" @click="changeStoreList">
						<image class="mer_logo" :src="storeInfo.mer_avatar" mode=""></image>
							{{storeInfo.mer_name}}					
						<text v-if="!downStatus" class="iconfont icon-xiala1 spin"></text>
						<text v-else class="iconfont icon-xiala1"></text>
					</view>			
				</view>	
			</view>
			<view class="scan_count">
				<view class="scan_bg"></view>
				<view v-if="!iShidden" class="whiteBg">
					<view class="input">
						<input type="number" placeholder-class='placeholder' placeholder="请输入核销码" v-model="verify_code" />
						<text @tap="codeChange">搜索</text>
					</view>
					<!-- #ifdef MP || MP-WEIXIN -->
					<view class="bnt" @tap="scanCode"><text class="iconfont icon-saoma"></text>扫码核销</view>
					<!-- #endif -->
					<!-- #ifdef H5 -->
					<view v-if="isWeixin" class="bnt" @tap="scanCode">
						<text class="iconfont icon-saoma"></text>
						扫码核销
					</view>
					<!-- #endif -->
				</view>
				<view v-if="iShidden">
					<view class="WriteOff">
						
						<view class="num acea-row row-between-wrapper">
							<text>订单号：{{ orderInfo.order_sn }}</text>
							<view class="views" @tap='goOrderDetails(orderInfo.order_id)'>查看<text class='iconfont icon-jiantou views-jian'></text></view>
						</view>
						<view class="order_count">
							<scroll-view scroll-y="true">
								<view v-for="(item,inidex) in orderInfo.orderProduct" :key="index" class="acea-row order_list">
									<view class="pictrue">
										<image :src="item.cart_info.product.image" />
									</view>
									<view class="name line2">{{item.cart_info.product.store_name}}</view>
									<view class="price">
										￥{{item.cart_info.product.price}}
										<br>
										x{{item.product_num}}
									</view>
								</view>
							</scroll-view>
							
							<view class="order_price">
								共{{orderInfo.total_num}}件商品，总金额 
								<text>￥{{orderInfo.total_price}}</text>
							</view>
						</view>
						
						<view class="sure" @click="confirm">确认核销</view>
						<view class="sure cancel" @click="cancel">返回</view>
					</view>
				</view>
			</view>
			
			<!-- #ifdef MP || MP-WEIXIN -->
		<!-- 	<view class="scan" @tap="scanCode">
				<image src="../static/images/scan.gif"></image>
			</view> -->
			<!-- #endif -->
			
			<!-- #ifdef H5 -->
		<!-- 	<view v-if="isWeixin" class="scan" @tap="scanCode">
				<image src="../static/images/scan.gif"></image>
			</view> -->
			<!-- #endif -->
		</view>
		
		<shopList ref="shopList" @changeStoreClose="changeStoreClose" @getStoreInfo="getStoreInfo" :id='mer_id'></shopList>
	</view>
</template>

<script>
	// +----------------------------------------------------------------------
	// | CRMEB [ CRMEB赋能开发者，助力企业发展 ]
	// +----------------------------------------------------------------------
	// | Copyright (c) 2016~2021 https://www.crmeb.com All rights reserved.
	// +----------------------------------------------------------------------
	// | Licensed CRMEB并不是自由软件，未经许可不能去掉CRMEB相关版权
	// +----------------------------------------------------------------------
	// | Author: CRMEB Team <admin@crmeb.com>
	// +----------------------------------------------------------------------
	import {orderVerific,verifierOrder} from "@/api/admin";
	import shopList from '@/components/shopList';
	export default {
		components:{ shopList },
		data() {
			return {
				iShidden: false,
				verify_code: '',
				orderInfo:{},
				isWeixin: false,
				mer_id: '',
				type: 'customer',
				storeInfo: {},
				downStatus: false
			}
		},
		
		onLoad: function(options) {
			// #ifdef MP
			if (options.scene) {
				let value = this.$util.getUrlParams(decodeURIComponent(options.scene) || {});
				if (value.verify_code) options.verify_code = value.verify_code;				
			}
			// #endif
			this.verify_code = options.verify_code;
			
			this.getStoreList();
			if(this.verify_code){
				this.codeChange();
			}	
			// #ifdef H5
			if(this.$wechat.isWeixin()){
				this.isWeixin = true;						
			}
			// #endif
		},
		methods: {
			// 关闭店铺弹窗
			changeStoreClose: function(){
				this.downStatus = false;
			},
			changeStoreList: function(data) {	
				this.downStatus = !this.downStatus;
				this.$refs.shopList.isShowStore();
			},
			getStoreList: function(){
				this.$nextTick(() => {
					this.$refs.shopList.getStoreList({is_verify:1})
				});				
			},
			getStoreInfo: function(data) {
				this.storeInfo = data
			},
			/**
			 * 去订单详情
			 */
			goOrderDetails: function(id) {
				uni.navigateTo({
					url: '/pages/admin/orderDetail/index?id='+id+'&mer_id='+this.storeInfo.mer_id
				});
			},
			// 立即核销
			codeChange: function() {
				let self = this
				let ref = /[0-9]/;
				if (!this.verify_code) return self.$util.Tips({
					title: '请输入核销码'
				});
				if (!ref.test(this.verify_code)) return self.$util.Tips({
					title: '请输入正确的核销码'
				});
				self.$util.Tips({
					title: '查询中'
				});
				setTimeout(() => {
					verifierOrder(this.storeInfo.mer_id,this.verify_code)
						.then(res => {
							self.orderInfo = res.data
							self.iShidden = true
						})
						.catch(res => {
							self.verify_code = ''
							return self.$util.Tips({
								title: res
							});
						});
				}, 800);
			},
			// 扫码核销			
			scanCode() {
				var self = this;
				// #ifdef MP
				wx.scanCode({
					scanType: ["qrCode", "barCode"],
					success(res) {
						self.verify_code = res.result
						self.codeChange();
					},
					fail(res) {
						console.log(res);
					},
				})
				// #endif
				//#ifdef H5
				if(this.$wechat.isWeixin()){
					this.$wechat.wechatEvevt('scanQRCode',{
						needResult: 1,
						scanType: ["qrCode", "barCode"]
					}).then(res=>{
						this.verify_code = res.resultStr
						this.codeChange();
					}).catch(res => {
						this.$util.Tips({
							title: res
						});
					});;
				}
				//#endif
			},			
			/**
			 * 确定销码
			 */
			confirm: function() {
				let self = this
				orderVerific({mer_id: this.orderInfo.mer_id, id: this.verify_code}).then(res => {
						self.verify_code = ''
						self.iShidden = false
						self.$util.Tips({
							title: res.message
						});
					})
					.catch(res => {
						self.$util.Tips({
							title: res
						});
					});
			},
			/**
			 * 取消
			 */
			cancel: function() {
				this.iShidden = false
			}
		}
	}
</script>

<style lang="scss">
	.page{
		// height: 100vh;
	}
	.OrderCancellation .header {
		padding-top: 30rpx;
		background-image: url('data:image/png;base64,');
		width: 100%;
		height: 520rpx;
		background-repeat: no-repeat;
		background-size: 100% 100%;
		position: relative;
	}
	.OrderCancellation {
		width: 100%;		
		
	}
	.OrderCancellation .title_bg {
		height: 90rpx;
		background: #E93323;
		width: 100%;
	}
	.OrderCancellation .scan_count{
		position: relative;
		top: -140rpx;
		width: 690rpx;
		margin: 0 auto;
	}
	.OrderCancellation .scan_bg{
		width: 100%;
		height: 70rpx;
		border-radius: 16rpx;
		background-image: url('data:image/png;base64,');
		background-size: 100%;
		background-repeat: no-repeat;

	}
	.OrderCancellation .whiteBg {
		width: 640rpx;
		background-color: #fff;
		margin: -47rpx auto 0;
		padding-top: 60rpx;
		border-radius: 4rpx 4rpx 16rpx 16rpx;
		padding-bottom: 77rpx;
		box-shadow: 0px 5px 20px rgba(0, 0, 0, 0.05);
	}
	.OrderCancellation .whiteBg .placeholder{
		color: #282828;
		font-size: 40rpx;
	}
	.OrderCancellation .whiteBg .input {
		width: 580rpx;
		background: #F4F4F4;
		margin: 0 auto;
		border-bottom: 1rpx solid #eee;
		padding: 0 100rpx 0 20rpx;
		border-radius: 10rpx;
		
		position: relative;
	}
	.OrderCancellation .whiteBg .input text{
		position: absolute;
		right: 20rpx;
		top: 30rpx;
		color: #666666;
		font-size: 32rpx;
	}
	.OrderCancellation .whiteBg .input input {
		font-size: 60rpx;
		color: #282828;
		line-height: 100rpx;
		height: 100rpx;		
	}
	.OrderCancellation .whiteBg .bnt {
		font-size: 32rpx;
		color: #fff;
		width: 80%;
		height: 86rpx;
		border-radius: 43rpx;
		background-image: linear-gradient(to right, #f67a38 0%, #f11b09 100%);
		background-image: -webkit-linear-gradient(to right, #f67a38 0%, #f11b09 100%);
		background-image: -moz-linear-gradient(to right, #f67a38 0%, #f11b09 100%);
		text-align: center;
		line-height: 86rpx;
		margin: 60rpx auto 0 auto;
	}
	.OrderCancellation .whiteBg .bnt .icon-saoma{
		color: #ffffff;
		font-size: 30rpx;
		margin-right: 15rpx;
	}
	.OrderCancellation .scan {
		width: 300rpx;
		height: 300rpx;
		margin: 160rpx auto 0 auto;
	}
	.OrderCancellation .scan image {
		width: 100%;
		height: 100%;
		display: block;
	}
	.WriteOff {
		width: 640rpx;
		background-color: #fff;
		margin: -47rpx auto 0;
		padding: 24rpx 30rpx;
		border-radius: 4rpx 4rpx 16rpx 16rpx;
		padding-bottom: 77rpx;
		box-shadow: 0px 5px 20px rgba(0, 0, 0, 0.05);
		}
	.WriteOff .pictrue {
		width: 340rpx;
		height: 340rpx;
		margin: 0 auto;
	}
	.WriteOff .pictrue image {
		width: 100%;
		height: 100%;
		display: block;
		border-radius: 10rpx;
	}
	.WriteOff .num {
		font-size: 28rpx;
		color: #282828;
		border-bottom: 1rpx solid #EEEEEE;
		padding-bottom: 22rpx;
	}
	.WriteOff .num .see {
		font-size: 16rpx;
		color: #fff;
		border-radius: 4rpx;
		background-color: #c68937;
		padding-left: 5rpx;
		margin-left: 12rpx;
	}
	.WriteOff .num .see .iconfont {
		font-size: 15rpx;
	}
	
	.WriteOff .sure {
		font-size: 32rpx;
		color: #fff;
		text-align: center;
		line-height: 86rpx;
		height: 86rpx;
		width: 580rpx;
		border-radius: 41rpx;
		margin: 40rpx auto 0 auto;
		background-image: linear-gradient(to right, #f67a38 0%, #f11b09 100%);
		background-image: -webkit-linear-gradient(to right, #f67a38 0%, #f11b09 100%);
		background-image: -moz-linear-gradient(to right, #f67a38 0%, #f11b09 100%);
	}
	.WriteOff .sure.cancel {
		background-image: none;
		color: #666666;
		margin-top: 30rpx;
		border: 1rpx solid #BBBBBB;
	}
	.WriteOff .order_count scroll-view{
		max-height: 450rpx;
	}
	.WriteOff .order_count .order_list{
		margin-top: 30rpx;
		justify-content: space-between;
		align-items: center;
	}
	.WriteOff .order_list .pictrue{
		width: 120rpx;
		height: 120rpx;
		border-radius: 10rpx;
	}
	.WriteOff .order_list .name{
		width: 280rpx;
		margin: 0 30rpx 0 20rpx;
		color: #282828;
		font-size: 28rpx;
	}
	.WriteOff .order_list .price{
		color: #999999;
		font-size: 28rpx;
		text-align: right;
		line-height: 40rpx;
	}
	.WriteOff .order_price{
		margin-top: 20rpx;
		text-align: right;
		font-size: 26rpx;
		text{
			color: #E93323;
			font-weight: bold;
		}
	}
	.views {
		font-size: 24rpx;
		color: #666666;
	}
	.views-jian {
		font-size: 10px;
	}
	.spin {
		display: block;
		transform: rotate(180deg);
		font-size: 36rpx;
	}
	.popupn{
		width: 100%;
		text-align: center;
		height: 60rpx;
		line-height: 60rpx;
		color: #fff;
		.title{
			background: rgba(0,0,0,.15);
			max-width: 360rpx;
			margin: 0 auto;
			position: relative;
			border-radius: 30rpx;
		}
		.iconfont{
			display: inline-block;
			position: relative;
			top: 4rpx;
			right: 0;
		}
		.mer_logo{
			width: 34rpx;
			height: 34rpx;
			position: relative;
			top: 6rpx;
			right: 10px;			
		}
		.mer_name{
			display: inline-block;
			max-width: 650rpx;
		}
		.invoice-content{
			background-color: #ffffff;
		}
	}
</style>
